INSERT INTO `lit_news` VALUES (1,'test_news_1','Test news','<div class=\"article-content\">\r\n<p><span style=\"font-size: medium;\">Следом за новым серийным электро <span style=\"color: #181818; line-height: 26px;\">кабриолетом от <span style=\"color: #000000; font-size: medium; line-height: 20px;\"><strong>Citroen</strong>, компания представит серийный коммерческий фургон <span style=\"color: #000000; font-size: medium; line-height: 20px;\">SpaceTourer, которому сделали специально для концепт версии, яркий футуристический дизайн, что бы привлечь к себе больше внимания, будут установлены пластиковые детали и обвесы. </span></span></span></span></p>\r\n<p><img src=\"http://vin64.ru/images/2036430.jpg\" border=\"0\">\r\n</p></div>','<div class=\"article-content\">\r\n<p><span style=\"font-size: medium;\">Следом за новым серийным электро <span style=\"color: #181818; line-height: 26px;\">кабриолетом от <span style=\"color: #000000; font-size: medium; line-height: 20px;\"><strong>Citroen</strong>, компания представит серийный коммерческий фургон <span style=\"color: #000000; font-size: medium; line-height: 20px;\">SpaceTourer, которому сделали специально для концепт версии, яркий футуристический дизайн, что бы привлечь к себе больше внимания, будут установлены пластиковые детали и обвесы. </span></span></span></span></p>\r\n<p><img src=\"http://vin64.ru/images/2036430.jpg\" border=\"0\">\r\n\r\n\r\n\r\n</p>\r\n<p><span style=\"font-size: medium;\">Силовая установка <span style=\"color: #000000; line-height: 20px;\"><strong>Citroen</strong></span> </span><span style=\"color: #000000; font-size: medium; line-height: 20px;\">SpaceTourer, дизельный двигатель в 150 л.с. <span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13px; line-height: 20px;\"><span style=\"font-size: medium;\">BlueHDi S&S. Установлена шести ступенчатая механическая коробка передач и полный привод который разработан в <span style=\"color: #000000; line-height: 20px;\">сотрудничестве с Automobiles Dangel. </span></span></span></span></p>\r\n<p><img src=\"http://vin64.ru/images/2036434.jpg\" border=\"0\"></p>\r\n<p><span style=\"font-size: medium;\">тэги: <a href=\"http://vin64.ru/katalog.html\">запчасти для иномарок в Саратове</a>, <a href=\"http://vin64.ru/citroen-/-sitroen/view-all-products.html\">запчасти для CITROEN / СИТРОЕН в Саратове</a>, <a href=\"http://vin64.ru/contacts.html\">запчасти для иномарок Саратов</a>.</span></p></div>','2016-03-03',1);
